import React from "react";
import { DivLogin, HeaderContent, Body, Input, Button } from "./style/login";
import { useNavigate } from "react-router-dom";
import { useForm } from "react-hook-form";

const Login = () => {
  const navigate = useNavigate();
  return (
    <Body>
      <DivLogin>
        <HeaderContent>
          <h1>Log In</h1>
        </HeaderContent>

        <form>
          <Input
            type="email"
            name="mail"
            placeholder="Enter Your Email"
            {...register("mail", { required: true, maxLength: 20 })}
            requuired
          />
          <Input
            type="password"
            name="pwd"
            placeholder="Enter Your Password"
            requuired
          />
          <Button
            onClick={() => {
              navigate("/");
            }}
          >
            Log In
          </Button>
        </form>
      </DivLogin>
    </Body>
  );
};

export default Login;
